import { useEffect } from 'react';

const PrintStrip = ({ strip, onClose }) => {
  useEffect(() => {
    // Auto-trigger print dialog when component mounts
    const timer = setTimeout(() => {
      window.print();
    }, 500);

    return () => clearTimeout(timer);
  }, []);

  useEffect(() => {
    // Listen for print events
    const handleAfterPrint = () => {
      onClose();
    };

    window.addEventListener('afterprint', handleAfterPrint);
    return () => window.removeEventListener('afterprint', handleAfterPrint);
  }, [onClose]);

  if (!strip) return null;

  return (
    <div className="print-container">
      {/* Print Styles */}
      <style jsx>{`
        @media print {
          /* Hide everything except print content */
          body * {
            visibility: hidden;
          }

          .print-container,
          .print-container * {
            visibility: visible;
          }

          .print-container {
            position: absolute;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            margin: 0;
            padding: 0;
          }

          /* Page setup for GSM paper */
          @page {
            size: A4;
            margin: 10mm;
            -webkit-print-color-adjust: exact;
            color-adjust: exact;
          }

          /* Strip layout - 2x6 format */
          .strip-print-layout {
            width: 100%;
            height: 100vh;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            background: white;
            page-break-inside: avoid;
          }

          .strip-grid {
            display: grid;
            grid-template-columns: 1fr 1fr;
            grid-template-rows: repeat(6, 1fr);
            gap: 2mm;
            width: 180mm;
            height: 250mm;
            background: white;
            padding: 5mm;
            border: 1px solid #ddd;
          }

          .strip-photo {
            width: 100%;
            height: 100%;
            object-fit: cover;
            border-radius: 2mm;
            border: 0.5mm solid #eee;
            background-size: cover;
            background-position: center;
            background-repeat: no-repeat;
          }

          .strip-info {
            grid-column: 1 / -1;
            text-align: center;
            padding: 2mm;
            font-size: 8pt;
            color: #666;
            border-top: 1px solid #eee;
            margin-top: 2mm;
          }

          /* Hide non-print elements */
          .no-print {
            display: none !important;
          }
        }

        /* Screen styles */
        @media screen {
          .print-container {
            position: fixed;
            top: 0;
            left: 0;
            width: 100vw;
            height: 100vh;
            background: rgba(0, 0, 0, 0.9);
            z-index: 9999;
            display: flex;
            justify-content: center;
            align-items: center;
          }

          .print-preview {
            background: white;
            padding: 20px;
            border-radius: 8px;
            max-width: 90vw;
            max-height: 90vh;
            overflow: auto;
          }

          .strip-grid {
            display: grid;
            grid-template-columns: 1fr 1fr;
            grid-template-rows: repeat(6, 1fr);
            gap: 4px;
            width: 300px;
            height: 400px;
            background: white;
            padding: 10px;
            border: 1px solid #ddd;
          }

          .strip-photo {
            width: 100%;
            height: 100%;
            object-fit: cover;
            border-radius: 4px;
            border: 1px solid #eee;
          }
        }
      `}</style>

      {/* Print Layout */}
      <div className="strip-print-layout">
        <div className="strip-grid">
          {/* Generate 12 copies of the photo (2x6 grid) */}
          {Array.from({ length: 12 }, (_, index) => (
            <div
              key={index}
              className="strip-photo"
              style={{
                backgroundImage: `url(${strip.imageUrl})`,
                backgroundColor: strip.customBackground?.value || '#ffffff'
              }}
            />
          ))}

          {/* Strip Information */}
          <div className="strip-info">
            <div>{strip.eventName || 'Photo Strip'}</div>
            <div>{new Date(strip.timestamp).toLocaleDateString()}</div>
          </div>
        </div>
      </div>

      {/* Screen Preview and Controls */}
      <div className="no-print print-preview">
        <div className="text-center mb-4">
          <h3 className="text-lg font-bold mb-2">Print Preview - 2x6 Strip Format</h3>
          <p className="text-sm text-gray-600 mb-4">
            {strip.eventName || 'Photo Strip'} - {new Date(strip.timestamp).toLocaleDateString()}
          </p>
        </div>

        <div className="strip-grid mb-4">
          {Array.from({ length: 12 }, (_, index) => (
            <div
              key={index}
              className="strip-photo"
              style={{
                backgroundImage: `url(${strip.imageUrl})`,
                backgroundColor: strip.customBackground?.value || '#ffffff'
              }}
            />
          ))}
        </div>

        <div className="flex justify-center space-x-4">
          <button
            onClick={() => window.print()}
            className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600"
          >
            🖨️ Print
          </button>
          <button
            onClick={onClose}
            className="px-4 py-2 bg-gray-500 text-white rounded hover:bg-gray-600"
          >
            ❌ Cancel
          </button>
        </div>
      </div>
    </div>
  );
};

export default PrintStrip;
